import { Routes, Route } from "react-router-dom";
import { Main } from "./components/main";
import { Login } from "./components/login";

function App() {
  return (
    <div>
      <header>
      </header>
      <Routes>
        <Route path="/main" element={<Main/>}/>
        <Route path="/login" element={<Login/>}/>
      </Routes>
    </div>
  );
}

export default App;
